import { useEffect, useState } from 'react';

function TableComponent() {
    const [tournament, setTournament] = useState('');
    const [level, setLevel] = useState('');
    const [year, setYear] = useState('');
    const [results, setResults] = useState([]);

    useEffect(() => {
        let url = 'http://127.0.0.1:5000/search?'
        url += tournament ? `tournament=${tournament}` : '&tournament=%';
        url += level ? `&level=${level}` : '&level=%';
        url += year ? `&year=${year}` : '&year=%';
        fetch(url)
        .then(res => res.json())
        .then(data => setResults(data))
        .catch(err => console.error(err));
    }
    , [tournament, level, year]);
    const handleTournamentChange = (e) => {
        setTournament(e.target.value);
    };
    const handleLevelChange = (e) => {
        setLevel(e.target.value);
    };
    const handleYearChange = (e) => {
        setYear(e.target.value);
    };
    return (
        <div style={{ textAlign: 'center', marginTop: '50px' }}>
            <h1>Certamen Library</h1>
            <input type="text" value={tournament} onChange={handleTournamentChange} placeholder="Tournament" />
            <input type="text" value={level} onChange={handleLevelChange} placeholder="Level" />
            <input type="text" value={year} onChange={handleYearChange} placeholder="Year" />
            <table>
                <thead>
                    <tr>
                        <th>Tournament</th>
                        <th>Level</th>
                        <th>Year</th>
                    </tr>
                </thead>
                <tbody>
                    {results.map((result, index) => (
                        <tr key={index}>
                            <td>{result.tournament}</td>
                            <td>{result.level}</td>
                            <td>{result.year}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}
export default TableComponent;
